import React from 'react';
import { Box, Grid, VStack, Heading, Text, Link, Code } from '@chakra-ui/react';

const Portfolio = () => {
  return (
    <Box textAlign="center" fontSize="xl">
      <Grid minH="100vh" p={3}>
        <VStack spacing={8}>
          <Heading>Param's Portfolio</Heading>
          <Text>
            Edit <Code fontSize="xl">src/App.js</Code> and save to reload.
          </Text>
          <Link
            to={'/home'}
            className="nav-link"
            style={{ margin: '0rem 1.1rem' }}
          >
            Home
          </Link>
          <Link to='/blogs'>Learn through blogs</Link>
          <Link to='/blogs/blog/mongoDB'>mongo db</Link>
          <Link to='/achivements'>achivements</Link>
          <Link to='/works'>works</Link>
        </VStack>
      </Grid>
    </Box>
  );
};

export default Portfolio;
